import React from 'react'; 
import {Cart} from './cartStyle'

class cart extends React.Component{
    constructor(){
        super()
        this.state = {}
    }

    render() {
        return (
             <Cart>
                 <h5>5 Items | Rp 125,000</h5>
             </Cart>
        );
    }
}

export default cart
